      subroutine ALC_mm(k1,k2,k3,k4,k5,k6,coeff,ampALC)
      implicit none
      include 'types.f'
c--- This is the leading colour amplitude in the notation
c---  (q1, Qb2, Q3, qb4)

      include 'constants.f'
      include 'nf.f'
      include 'mxpart.f'
      include 'cplx.h'
      include 'momwbbm.f'
      include 'zprods_com.f'
      include 'Wbbmlabels.f'
      integer:: k1,k2,k3,k4,k5,k6,v1,v2,nu,j,eta,k34f,k56f
      complex(dp):: ampALC(2,2)
      real(dp):: p2(4),p3(4),p23(4),p123(4),p234(4),p1234(4),
     & p12(4),p34(4),p56(4),s23,s123,s234,s34,s12,s1234,msq,mb
      complex(dp):: zab,zaba,zbab,zabab,ampLO
      real(dp):: K1f(4),K2f(4),p1Dp3,p1Dp4,p2Dp3,p2Dp4
      real(dp):: n1(4),n2(4),p3DP,etaDp3,etaDP,al1,al2,kappa
      complex(dp):: S1,S2,K1DK2,gamma,den,a11,a12,a21,a22
      complex(dp):: gam,be,besq
      complex(dp):: zaP2b,zaP3b,zaP12b,zaP23b,zaP34b,zaP123b,
     & zaP234b,zaP1234b
      complex(dp):: zaP2bP123a,zaP123bP3a,zaP12bP3a
      complex(dp):: zbP123aP3b,zbP12aP3b,zbP23aP3b,zaP23bP3a,
     & zbP34aP2b
      real(dp):: kappa1,kappa2,p3Dp12,p34Dp12
      parameter(k34f=7,k56f=8)
c--- statement functions to define zab spinor strings
      zaP2b(v1,v2)=bp*za(v1,k2)*zb(k2,v2)+bm*za(v1,k3)*zb(k3,v2)
      zaP3b(v1,v2)=bp*za(v1,k3)*zb(k3,v2)+bm*za(v1,k2)*zb(k2,v2)
      zaP12b(v1,v2)=bp*za(v1,k2)*zb(k2,v2)+bm*za(v1,k3)*zb(k3,v2)
     &             +za(v1,k1)*zb(k1,v2)
      zaP23b(v1,v2)=za(v1,k2)*zb(k2,v2)+za(v1,k3)*zb(k3,v2)
      zaP34b(v1,v2)=bp*za(v1,k3)*zb(k3,v2)+bm*za(v1,k2)*zb(k2,v2)
     &             +za(v1,k4)*zb(k4,v2)
      zaP123b(v1,v2)=za(v1,k2)*zb(k2,v2)+za(v1,k3)*zb(k3,v2)
     &              +za(v1,k1)*zb(k1,v2)
      zaP234b(v1,v2)=za(v1,k2)*zb(k2,v2)+za(v1,k3)*zb(k3,v2)
     &  +za(v1,k4)*zb(k4,v2)
      zaP1234b(v1,v2)=-za(v1,k5)*zb(k5,v2)-za(v1,k6)*zb(k6,v2)
c--- statement functions to define zaba spinor strings
      zaP2bP123a(v1,v2)=bp*za(v1,k2)*zaP123b(v2,k2)
     &                 +bm*za(v1,k3)*zaP123b(v2,k3)
      zaP123bP3a(v1,v2)=bp*zaP123b(v1,k3)*za(k3,v2)
     &                 +bm*zaP123b(v1,k2)*za(k2,v2)
      zaP12bP3a(v1,v2)=bp*zaP12b(v1,k3)*za(k3,v2)
     &                +bm*zaP12b(v1,k2)*za(k2,v2)
      zaP23bP3a(v1,v2)=bp*zaP23b(v1,k3)*za(k3,v2)
     &                +bm*zaP23b(v1,k2)*za(k2,v2)
c      zaP2bP34a(v1,v2)=bp*za(v1,k2)*zaP34b(v2,k2)
c     &                +bm*za(v1,k3)*zaP34b(v2,k3)
c      zaP234bP34a(v1,v2)=bp*zaP234b(v1,k3)*za(k3,v2)
c     &                  +bm*zaP234b(v1,k2)*za(k2,v2)
c     &                  +zaP234b(v1,k4)*za(k4,v2)
c      zaP34bP2a(v1,v2)=bp*zaP34b(v1,k2)*za(k2,v2)
c     &                +bm*zaP34b(v1,k3)*za(k3,v2)
c--- statement functions to define zbab spinor strings
c      zbP2aP123b(v1,v2)=bp*zb(v1,k2)*zaP123b(k2,v2)
c     &                 +bm*zb(v1,k3)*zaP123b(k3,v2)
      zbP123aP3b(v1,v2)=bp*zaP123b(k3,v1)*zb(k3,v2)
     &                 +bm*zaP123b(k2,v1)*zb(k2,v2)
      zbP12aP3b(v1,v2)=bp*zaP12b(k3,v1)*zb(k3,v2)
     &                +bm*zaP12b(k2,v1)*zb(k2,v2)
      zbP23aP3b(v1,v2)=bp*zaP23b(k3,v1)*zb(k3,v2)
     &                +bm*zaP23b(k2,v1)*zb(k2,v2)
c      zbP2aP34b(v1,v2)=bp*zb(v1,k2)*zaP34b(k2,v2)
c     &                +bm*zb(v1,k3)*zaP34b(k3,v2)
c      zbP234aP34b(v1,v2)=bp*zaP234b(k3,v1)*zb(k3,v2)
c     &                  +bm*zaP234b(k2,v1)*zb(k2,v2)
c     &                  +zaP234b(k4,v1)*zb(k4,v2)
      zbP34aP2b(v1,v2)=bp*zaP34b(k2,v1)*zb(k2,v2)
     &                +bm*zaP34b(k3,v1)*zb(k3,v2)


c--- zero out all integral coefficients
      call clearcoeffs(coeff)

      do nu=1,4
      p2(nu)=bp*mom(k2,nu)+bm*mom(k3,nu)
      p3(nu)=bp*mom(k3,nu)+bm*mom(k2,nu)
      p12(nu)=mom(k1,nu)+p2(nu)
      p34(nu)=p3(nu)+mom(k4,nu)
      p23(nu)=p2(nu)+p3(nu)
      p123(nu)=p23(nu)+mom(k1,nu)
      p234(nu)=p23(nu)+mom(k4,nu)
      p1234(nu)=p123(nu)+mom(k4,nu)
      p56(nu)=-p1234(nu)
      enddo

      s23=p23(4)**2-p23(1)**2-p23(2)**2-p23(3)**2
      s123=p123(4)**2-p123(1)**2-p123(2)**2-p123(3)**2
      s234=p234(4)**2-p234(1)**2-p234(2)**2-p234(3)**2
      s34=p34(4)**2-p34(1)**2-p34(2)**2-p34(3)**2
      s12=p12(4)**2-p12(1)**2-p12(2)**2-p12(3)**2
      s1234=p1234(4)**2-p1234(1)**2-p1234(2)**2-p1234(3)**2
c      p1Dp2=mom(k1,4)*p2(4)-mom(k1,1)*p2(1)
c     &-mom(k1,2)*p2(2)-mom(k1,3)*p2(3)
      p1Dp3=mom(k1,4)*p3(4)-mom(k1,1)*p3(1)
     &-mom(k1,2)*p3(2)-mom(k1,3)*p3(3)
      p2Dp4=mom(k4,4)*p2(4)-mom(k4,1)*p2(1)
     &-mom(k4,2)*p2(2)-mom(k4,3)*p2(3)
      p2Dp3=p2(4)*p3(4)-p2(1)*p3(1)
     &-p2(2)*p3(2)-p2(3)*p3(3)
      p1Dp4=mom(k1,4)*mom(k4,4)-mom(k1,1)*mom(k4,1)
     &-mom(k1,2)*mom(k4,2)-mom(k1,3)*mom(k4,3)
c      p3Dp4=mom(k4,4)*p3(4)-mom(k4,1)*p3(1)
c     &-mom(k4,2)*p3(2)-mom(k4,3)*p3(3)
      msq=p2(4)**2-p2(1)**2-p2(2)**2-p2(3)**2
      mb=sqrt(msq)
      besq=1d0-4d0*bm*bp
      be=sqrt(besq)

      amplo=(za(k3,k1)*zb(k4,k5)
     &     *(za(k6,k1)*zb(k1,k3)+za(k6,k2)*zb(k2,k3))/s123
     &      -zb(k3,k4)*za(k1,k6)
     &     *(zb(k5,k2)*za(k2,k3)+zb(k5,k4)*za(k4,k3))/s234)
     &      *2d0*mb/zb(k2,k3)/s23/s1234

c---------------------------- BOXES -----------------------------------

c--- this is the (1,2,34) box

      coeff(4,d1x2x34)= + mb*s234**(-1)*bp**(-1) * (  - 1.D0/2.D0/(za(
     &    k5,k6))/(zb(k2,k3))/(zb(k2,k3))/(zb(k5,k6))/(zbab(k4,p23,p2,
     &    k1))*za(k1,k6)*zb(k2,k4)*zb(k3,k4)*zbab(k5,p234,p2,k1) - 1.D0/
     &    2.D0/(za(k5,k6))/(zb(k2,k3))/(zb(k2,k3))/(zb(k5,k6))/(zaP23b(
     &    k1,k4))*za(k1,k6)*zb(k2,k4)*zb(k3,k4)*zaP234b(k1,k5) - 1.D0/2.
     &    D0/(za(k5,k6))/(zb(k2,k3))/(zb(k5,k6))/(zaP23b(k1,k4))/(zaba(
     &    k4,p23,p2,k1))*za(k1,k6)*zabab(k1,p2,p234,p3,k4)*zaP234b(k1,
     &    k5) - 1.D0/2.D0/(za(k5,k6))/(zb(k2,k3))/(zb(k5,k6))/(zaP23b(
     &    k4,k1))/(zbab(k4,p23,p2,k1))*za(k1,k6)*zbab(k4,p3,p234,k1)*
     &    zbab(k5,p234,p2,k1) )
      coeff(4,d1x2x34) = coeff(4,d1x2x34) + mb*bp**(-1) * ( 1.D0/2.D0/(
     &    za(k5,k6))/(zb(k2,k3))/(zb(k2,k3))/(zb(k5,k6))/(zaP23b(k4,k1)
     &    )/(zbP34aP2b(k1,k1))/(zbab(k4,p23,p2,k1))*za(k1,k6)*zb(k1,k2)
     &    *zb(k1,k3)*zbab(k4,p3,p234,k1)*zbab(k5,p234,p2,k1) - 1.D0/2.D0
     &    /(za(k5,k6))/(zb(k2,k3))/(zb(k2,k3))/(zb(k5,k6))/(zbP34aP2b(
     &    k1,k1))/(zbab(k4,p23,p2,k1))*za(k1,k6)*zb(k1,k3)*zb(k1,k4)*
     &    zb(k2,k4)*zbab(k5,p234,p2,k1) + 1.D0/2.D0/(za(k5,k6))/(zb(k2,
     &    k3))/(zb(k2,k3))/(zb(k5,k6))/(zbP34aP2b(k1,k1))/(zbab(k4,p23,
     &    p2,k1))*zb(k2,k4)*zb(k3,k4)*zbab(k5,p234,p2,k1)*zaP2b(k6,k1)
     &     + 1.D0/2.D0/(za(k5,k6))/(zb(k2,k3))/(zb(k5,k6))/(zaP23b(k4,
     &    k1))/(zbP34aP2b(k1,k1))/(zbab(k4,p23,p2,k1))*zbab(k4,p3,p234,
     &    k1)*zbab(k5,p234,p2,k1)*zaP2b(k6,k1) )
      coeff(4,d1x2x34) = coeff(4,d1x2x34) + mb*s234*bp**(-1) * (  - 1.D0
     &    /2.D0/(za(k5,k6))/(zb(k2,k3))/(zb(k2,k3))/(zb(k5,k6))/(
     &    zaP23b(k4,k1))/(zbP34aP2b(k1,k1))/(zbP34aP2b(k1,k1))/(zbab(k4
     &    ,p23,p2,k1))*zb(k1,k2)*zb(k1,k3)*zbab(k4,p3,p234,k1)*zbab(k5,
     &    p234,p2,k1)*zaP2b(k6,k1) + 1.D0/2.D0/(za(k5,k6))/(zb(k2,k3))
     &    /(zb(k2,k3))/(zb(k5,k6))/(zbP34aP2b(k1,k1))/(zbP34aP2b(k1,k1)
     &    )/(zbab(k4,p23,p2,k1))*zb(k1,k3)*zb(k1,k4)*zb(k2,k4)*zbab(k5,
     &    p234,p2,k1)*zaP2b(k6,k1) )


c--- this is the (12,3,4) box

      coeff(4,d12x3x4)= + mb*bp**(-1)*s123**(-1) * (  - 1.D0/2.D0/(za(
     &    k5,k6))/(zb(k2,k3))/(zb(k2,k3))/(zb(k5,k6))/(zaP23b(k4,k1))/(
     &    zaP12bP3a(k4,k4))*zb(k4,k5)*zaP123b(k4,k2)*zaP123b(k4,k3)*
     &    zaP123bP3a(k6,k4) - 1.D0/2.D0/(za(k5,k6))/(zb(k2,k3))/(zb(k2,
     &    k3))/(zb(k5,k6))/(zbP23aP3b(k1,k4))/(zbP12aP3b(k4,k4))*zb(k4,
     &    k5)*zaP123b(k6,k4)*zbP123aP3b(k2,k4)*zbP123aP3b(k3,k4) - 1.D0/
     &    2.D0/(za(k5,k6))/(zb(k2,k3))/(zb(k5,k6))/(zaP23b(k1,k4))/(
     &    zbP23aP3b(k1,k4))*zb(k4,k5)*zabab(k1,p2,p123,p3,k4)*zaP123b(
     &    k6,k4) - 1.D0/2.D0/(za(k5,k6))/(zb(k2,k3))/(zb(k5,k6))/(
     &    zaP23b(k4,k1))/(zaP23bP3a(k1,k4))*zb(k4,k5)*zaP2bP123a(k1,k4)
     &    *zaP123bP3a(k6,k4) )
      coeff(4,d12x3x4) = coeff(4,d12x3x4) + mb*bp**(-1) * (  - 1.D0/2.D0
     &    /(za(k5,k6))/(zb(k2,k3))/(zb(k2,k3))/(zb(k5,k6))/(zaP23b(k1,
     &    k4))/(zbP23aP3b(k1,k4))/(zbP12aP3b(k4,k4))*zb(k2,k4)*zb(k3,k4
     &    )*zb(k4,k5)*zabab(k1,p2,p123,p3,k4)*zaP123b(k6,k4) + 1.D0/2.D0
     &    /(za(k5,k6))/(zb(k2,k3))/(zb(k2,k3))/(zb(k5,k6))/(zaP23b(k4,
     &    k1))/(zaP12bP3a(k4,k4))/(zaP12bP3a(k4,k4))*zaP3b(k4,k5)*
     &    zaP123b(k4,k2)*zaP123b(k4,k3)*zaP123bP3a(k6,k4) + 1.D0/2.D0/(
     &    za(k5,k6))/(zb(k2,k3))/(zb(k2,k3))/(zb(k5,k6))/(zbP23aP3b(k1,
     &    k4))/(zbP12aP3b(k4,k4))/(zbP12aP3b(k4,k4))*zb(k2,k4)*zb(k4,k5
     &    )*zaP123b(k6,k4)*zbP123aP3b(k3,k4)*zbP123aP3b(k4,k4) + 1.D0/2.
     &    D0/(za(k5,k6))/(zb(k2,k3))/(zb(k5,k6))/(zaP23b(k4,k1))/(
     &    zaP23bP3a(k1,k4))/(zaP12bP3a(k4,k4))*zaP3b(k4,k5)*zaP2bP123a(
     &    k1,k4)*zaP123bP3a(k6,k4) )


c--- this is the (1,2,3) box

      coeff(4,d1x2x3)= + mb*s123**(-1) * (  - 1/(za(k2,k3))/(zb(k2,k3))
     &    /(zb(k5,k6))/(zaP23b(k1,k4))*za(k1,k2)*za(k1,k3)*zb(k4,k5)**2
     &     - 1/(za(k5,k6))/(zb(k1,k2))/(zb(k1,k3))/(zaP23b(k4,k1))*
     &    zaP2b(k6,k1)**2*be**(-2) - 1/(za(k5,k6))/(zb(k2,k3))/(zb(k2,
     &    k3))/(zaP23b(k4,k1))*za(k1,k6)**2*zb(k1,k2)*zb(k1,k3) - 2.D0
     &    /(za(k5,k6))/(zb(k2,k3))/(zaP23b(k4,k1))*za(k1,k6)*zaP2b(k6,
     &    k1)*be**(-1) )
      coeff(4,d1x2x3) = coeff(4,d1x2x3) + mb * (  - 1.D0/2.D0/(za(k5,k6
     &    ))/(zb(k2,k3))/(zaP23b(k1,k4))/(zaba(k4,p23,p2,k1))*za(k1,k2)
     &    *za(k1,k6)**2*zb(k2,k4)*be + 1.D0/2.D0/(za(k5,k6))/(zb(k2,k3)
     &    )/(zaP23b(k1,k4))/(zaba(k4,p23,p2,k1))*za(k1,k6)**2*zaP2b(k1,
     &    k4) )
      coeff(4,d1x2x3) = coeff(4,d1x2x3) + mb*bp * (  - 1.D0/2.D0/(zb(k2
     &    ,k3))/(zb(k5,k6))/(zbab(k4,p23,p2,k1))*zb(k4,k5)**2 )


c--- this is the (2,3,4) box

      coeff(4,d2x3x4)= + mb*s234**(-1) * (  - 1/(za(k2,k3))/(zb(k2,k3))
     &    /(zb(k5,k6))/(zaP23b(k4,k1))*za(k2,k4)*za(k3,k4)*zb(k4,k5)**2
     &     - 1/(za(k2,k4))/(za(k3,k4))/(zb(k2,k3))/(zb(k5,k6))/(zaP23b(
     &    k4,k1))*za(k2,k3)*zaP3b(k4,k5)**2*be**(-2) - 1/(za(k5,k6))/(
     &    zb(k2,k3))/(zb(k2,k3))/(zaP23b(k1,k4))*za(k1,k6)**2*zb(k2,k4)
     &    *zb(k3,k4) + 2.D0/(zb(k2,k3))/(zb(k5,k6))/(zaP23b(k4,k1))*zb(
     &    k4,k5)*zaP3b(k4,k5)*be**(-1) )
      coeff(4,d2x3x4) = coeff(4,d2x3x4) + mb * (  - 1.D0/2.D0/(za(k5,k6
     &    ))/(zb(k2,k3))/(zaP23bP3a(k1,k4))*za(k1,k6)**2 + 1.D0/2.D0/(
     &    zb(k2,k3))/(zb(k5,k6))/(zaP23b(k1,k4))/(zbP23aP3b(k1,k4))*za(
     &    k1,k3)*zb(k3,k4)*zb(k4,k5)**2 + 1.D0/2.D0/(zb(k2,k3))/(zb(k5,
     &    k6))/(zaP23b(k1,k4))/(zbP23aP3b(k1,k4))*za(k1,k3)*zb(k3,k4)*
     &    zb(k4,k5)**2*be - 1.D0/2.D0/(zb(k2,k3))/(zb(k5,k6))/(zaP23b(
     &    k1,k4))/(zbP23aP3b(k1,k4))*zb(k4,k5)**2*zaP3b(k1,k4) - 1.D0/2.
     &    D0/(zb(k2,k3))/(zb(k5,k6))/(zaP23b(k1,k4))/(zbP23aP3b(k1,k4))
     &    *zb(k4,k5)**2*zaP3b(k1,k4)*be**(-1) + 1.D0/4.D0/(zb(k2,k3))/(
     &    zb(k5,k6))/(zbP23aP3b(k1,k4))*zb(k4,k5)**2 + 1.D0/4.D0/(zb(k2
     &    ,k3))/(zb(k5,k6))/(zbP23aP3b(k1,k4))*zb(k4,k5)**2*be**(-1) )
      coeff(4,d2x3x4) = coeff(4,d2x3x4) + mb*bp * ( 1.D0/2.D0/(za(k5,k6
     &    ))/(zb(k2,k3))/(zaP23bP3a(k1,k4))*za(k1,k6)**2 )


c--- this is the (1,23,4) box

      coeff(4,d1x23x4)= + mb*bp**(-1) * (  - 1.D0/4.D0/(za(k1,k4))/(za(
     &    k2,k3))/(za(k5,k6))/(zb(k2,k3))/(zb(k2,k3))/(zaP23b(k1,k1))/(
     &    zaP23b(k4,k4))*za(k1,k2)*za(k1,k6)**2*zb(k2,k4)*zaP23b(k4,k1)
     &     + 1.D0/4.D0/(za(k1,k4))/(za(k2,k3))/(za(k5,k6))/(zb(k2,k3))
     &    /(zb(k2,k3))/(zaP23b(k1,k1))/(zaP23b(k4,k4))*za(k1,k3)*za(k1,
     &    k6)**2*zb(k3,k4)*zaP23b(k4,k1) + 1.D0/4.D0/(za(k1,k4))/(za(k2
     &    ,k3))/(za(k5,k6))/(zb(k2,k3))/(zb(k2,k3))/(zaP23b(k1,k1))/(
     &    zaP23b(k4,k4))*za(k1,k6)**2*za(k2,k4)*zb(k1,k2)*zaP23b(k1,k4)
     &     - 1.D0/4.D0/(za(k1,k4))/(za(k2,k3))/(za(k5,k6))/(zb(k2,k3))
     &    /(zb(k2,k3))/(zaP23b(k1,k1))/(zaP23b(k4,k4))*za(k1,k6)**2*za(
     &    k3,k4)*zb(k1,k3)*zaP23b(k1,k4) + 1.D0/2.D0/(za(k1,k4))/(za(k2
     &    ,k3))/(za(k5,k6))/(zb(k2,k3))/(zb(k2,k3))/(zaP23b(k1,k1))/(
     &    zaP23b(k4,k4))*za(k1,k6)**2*zb(k1,k4)*zaba(k4,p2,p23,k1) - 1.D
     &    0/2.D0/(za(k1,k4))/(za(k2,k3))/(za(k5,k6))/(zb(k2,k3))/(zb(k2
     &    ,k3))/(zaP23b(k1,k1))/(zaP23b(k4,k4))*za(k1,k6)**2*zaP2b(k1,
     &    k4)*zaP23b(k4,k1) )
      coeff(4,d1x23x4) = coeff(4,d1x23x4) + mb*bp**(-1) * ( 1.D0/2.D0/(
     &    za(k1,k4))/(za(k2,k3))/(za(k5,k6))/(zb(k2,k3))/(zb(k2,k3))/(
