     &    ,k56f))/(za(k56f,k34f))/(zb(k2,k3))/(zb(k2,k3))/(zb(k56f,k34f
     &    ))/(zaP34b(k4,k56f))/(zaP34b(k56f,k56f))*za(k1,k56f)*za(k6,
     &    k56f)*zb(k2,k56f)*zb(k3,k56f)*zaP34b(k4,k5)*s34 + 1/(za(k56f,
     &    k34f))/(zb(k2,k3))/(zb(k2,k3))/(zb(k4,k34f))/(zaP34b(k4,k4))
     &    /(zaP34b(k56f,k4))/(zaP34b(k56f,k56f))*za(k1,k56f)*za(k6,k56f
     &    )*zb(k2,k4)*zb(k3,k4)*zb(k4,k5)*s34**2 + 1/(za(k56f,k34f))/(
     &    zb(k2,k3))/(zb(k2,k3))/(zb(k4,k34f))/(zaP34b(k4,k34f))/(
     &    zaP34b(k56f,k34f))/(zaP34b(k56f,k56f))*za(k1,k56f)*za(k6,k56f
     &    )*zb(k2,k34f)*zb(k3,k4)*zb(k5,k34f)*s34**2 - 1/(za(k56f,k34f)
     &    )/(zb(k2,k3))/(zb(k2,k3))/(zb(k4,k34f))/(zaP34b(k56f,k4))/(
     &    zaP34b(k56f,k56f))*za(k1,k56f)*za(k6,k56f)*zb(k2,k4)*zb(k3,k4
     &    )*zb(k4,k5)*s34 )
      coeff(2,b34) = coeff(2,b34) + mb*bp**(-1)*s1234**(-1) * (  - 1/(
     &    za(k56f,k34f))/(zb(k2,k3))/(zb(k2,k3))/(zb(k4,k34f))/(zaP34b(
     &    k56f,k34f))/(zaP34b(k56f,k56f))*za(k1,k56f)*za(k6,k56f)*zb(k2
     &    ,k4)*zb(k3,k4)*zb(k5,k34f)*s34 + 1/(za(k56f,k34f))/(zb(k2,k3)
     &    )/(zb(k2,k3))/(zb(k4,k56f))/(zb(k56f,k34f))/(zaP34b(k4,k34f))
     &    /(zaP34b(k34f,k34f))/(zaP34b(k56f,k34f))*za(k1,k56f)*za(k6,
     &    k34f)*zb(k2,k34f)*zb(k3,k56f)*zb(k4,k34f)*zb(k5,k34f)*s34**2
     &     - 1/(za(k56f,k34f))/(zb(k2,k3))/(zb(k2,k3))/(zb(k4,k56f))/(
     &    zb(k56f,k34f))/(zaP34b(k4,k56f))/(zaP34b(k34f,k34f))/(zaP34b(
     &    k56f,k56f))*za(k1,k56f)*za(k6,k34f)*zb(k2,k56f)*zb(k3,k56f)*
     &    zb(k4,k34f)*zb(k5,k56f)*s34**2 - 1/(za(k56f,k34f))/(zb(k2,k3)
     &    )/(zb(k2,k3))/(zb(k4,k56f))/(zb(k56f,k34f))/(zaP34b(k34f,k34f
     &    ))/(zaP34b(k56f,k34f))*za(k1,k56f)*za(k6,k34f)*zb(k2,k4)*zb(
     &    k3,k56f)*zb(k4,k34f)*zb(k5,k34f)*s34 + 1/(za(k56f,k34f))/(zb(
     &    k2,k3))/(zb(k2,k3))/(zb(k4,k56f))/(zb(k56f,k34f))/(zaP34b(
     &    k34f,k34f))/(zaP34b(k56f,k56f))*za(k1,k56f)*za(k6,k34f)*zb(k2
     &    ,k4)*zb(k3,k56f)*zb(k4,k34f)*zb(k5,k56f)*s34 )
      coeff(2,b34) = coeff(2,b34) + mb*bp**(-1)*s1234**(-1) * (  - 1/(
     &    za(k56f,k34f))/(zb(k2,k3))/(zb(k2,k3))/(zb(k4,k56f))/(zaP34b(
     &    k4,k4))/(zaP34b(k34f,k34f))/(zaP34b(k56f,k4))*za(k1,k56f)*za(
     &    k6,k34f)*zb(k2,k4)*zb(k3,k4)*zb(k4,k5)*s34**2 - 1/(za(k56f,
     &    k34f))/(zb(k2,k3))/(zb(k2,k3))/(zb(k4,k56f))/(zaP34b(k4,k34f)
     &    )/(zaP34b(k34f,k34f))/(zaP34b(k56f,k34f))*za(k1,k56f)*za(k6,
     &    k34f)*zb(k2,k34f)*zb(k3,k4)*zb(k5,k34f)*s34**2 + 1/(za(k56f,
     &    k34f))/(zb(k2,k3))/(zb(k2,k3))/(zb(k4,k56f))/(zaP34b(k34f,
     &    k34f))/(zaP34b(k56f,k4))*za(k1,k56f)*za(k6,k34f)*zb(k2,k4)*
     &    zb(k3,k4)*zb(k4,k5)*s34 + 1/(za(k56f,k34f))/(zb(k2,k3))/(zb(
     &    k2,k3))/(zb(k4,k56f))/(zaP34b(k34f,k34f))/(zaP34b(k56f,k34f))
     &    *za(k1,k56f)*za(k6,k34f)*zb(k2,k4)*zb(k3,k4)*zb(k5,k34f)*s34
     &     - 1/(za(k56f,k34f))/(zb(k2,k3))/(zb(k2,k3))/(zb(k56f,k34f))
     &    /(zaP34b(k4,k34f))/(zaP34b(k56f,k34f))/(zaP34b(k56f,k56f))*
     &    za(k1,k56f)*za(k6,k56f)*zb(k2,k34f)*zb(k3,k56f)*zb(k5,k34f)*
     &    s34**2 )
      coeff(2,b34) = coeff(2,b34) + mb*bp**(-1)*s1234**(-1) * ( 1/(za(
     &    k56f,k34f))/(zb(k2,k3))/(zb(k2,k3))/(zb(k56f,k34f))/(zaP34b(
     &    k4,k56f))/(zaP34b(k56f,k56f))/(zaP34b(k56f,k56f))*za(k1,k56f)
     &    *za(k6,k56f)*zb(k2,k56f)*zb(k3,k56f)*zb(k5,k56f)*s34**2 + 1/(
     &    za(k56f,k34f))/(zb(k2,k3))/(zb(k2,k3))/(zb(k56f,k34f))/(
     &    zaP34b(k56f,k34f))/(zaP34b(k56f,k56f))*za(k1,k56f)*za(k6,k56f
     &    )*zb(k2,k4)*zb(k3,k56f)*zb(k5,k34f)*s34 - 1/(za(k56f,k34f))/(
     &    zb(k2,k3))/(zb(k2,k3))/(zb(k56f,k34f))/(zaP34b(k56f,k56f))/(
     &    zaP34b(k56f,k56f))*za(k1,k56f)*za(k6,k56f)*zb(k2,k4)*zb(k3,
     &    k56f)*zb(k5,k56f)*s34 - 1/(zb(k2,k3))/(zb(k2,k3))/(zb(k4,k34f
     &    ))/(zb(k4,k56f))/(zaP34b(k4,k4))/(zaP34b(k34f,k4))/(zaP34b(
     &    k56f,k4))*zb(k2,k4)*zb(k3,k4)*zb(k4,k5)*zaP34b(k1,k4)*zaP34b(
     &    k6,k4)*s34 - 1/(zb(k2,k3))/(zb(k2,k3))/(zb(k4,k34f))/(zb(k4,
     &    k56f))/(zaP34b(k4,k34f))/(zaP34b(k34f,k34f))/(zaP34b(k34f,
     &    k34f))/(zaP34b(k56f,k34f))*zb(k2,k34f)*zb(k3,k4)*zb(k5,k34f)*
     &    zaP34b(k1,k34f)*zaP34b(k6,k34f)*zaP34b(k34f,k4)*s34 )
      coeff(2,b34) = coeff(2,b34) + mb*bp**(-1)*s1234**(-1) * ( 1/(zb(
     &    k2,k3))/(zb(k2,k3))/(zb(k4,k34f))/(zb(k4,k56f))/(zaP34b(k34f,
     &    k4))/(zaP34b(k56f,k4))*zb(k2,k4)*zb(k3,k4)*zb(k4,k5)*zaP34b(
     &    k1,k4)*zaP34b(k6,k4) + 1/(zb(k2,k3))/(zb(k2,k3))/(zb(k4,k34f)
     &    )/(zb(k4,k56f))/(zaP34b(k34f,k34f))/(zaP34b(k34f,k34f))/(
     &    zaP34b(k56f,k34f))*zb(k2,k4)*zb(k3,k4)*zb(k5,k34f)*zaP34b(k1,
     &    k34f)*zaP34b(k6,k34f)*zaP34b(k34f,k4) + 1/(zb(k2,k3))/(zb(k2,
     &    k3))/(zb(k4,k56f))/(zb(k56f,k34f))/(zaP34b(k4,k34f))/(zaP34b(
     &    k34f,k34f))/(zaP34b(k34f,k34f))/(zaP34b(k56f,k34f))*za(k6,
     &    k34f)*zb(k2,k34f)*zb(k3,k56f)*zb(k4,k34f)*zb(k5,k34f)*zaP34b(
     &    k1,k34f)*s34**2 + 1/(zb(k2,k3))/(zb(k2,k3))/(zb(k4,k56f))/(
     &    zb(k56f,k34f))/(zaP34b(k4,k34f))/(zaP34b(k34f,k34f))/(zaP34b(
     &    k34f,k34f))/(zaP34b(k56f,k34f))*zb(k2,k34f)*zb(k3,k56f)*zb(k5
     &    ,k34f)*zaP34b(k1,k34f)*zaP34b(k6,k34f)*zaP34b(k34f,k4)*s34 -
     &    1/(zb(k2,k3))/(zb(k2,k3))/(zb(k4,k56f))/(zb(k56f,k34f))/(
     &    zaP34b(k4,k56f))/(zaP34b(k34f,k34f))/(zaP34b(k34f,k56f))/(
     &    zaP34b(k56f,k56f))*za(k6,k34f)*zb(k2,k56f)*zb(k3,k56f)*zb(k4,
     &    k34f)*zb(k5,k56f)*zaP34b(k1,k56f)*s34**2 )
      coeff(2,b34) = coeff(2,b34) + mb*bp**(-1)*s1234**(-1) * (  - 1/(
     &    zb(k2,k3))/(zb(k2,k3))/(zb(k4,k56f))/(zb(k56f,k34f))/(zaP34b(
     &    k4,k56f))/(zaP34b(k34f,k56f))/(zaP34b(k56f,k56f))/(zaP34b(
     &    k56f,k56f))*zb(k2,k56f)*zb(k3,k56f)*zb(k5,k56f)*zaP34b(k1,
     &    k56f)*zaP34b(k6,k56f)*zaP34b(k56f,k4)*s34 - 1/(zb(k2,k3))/(
     &    zb(k2,k3))/(zb(k4,k56f))/(zb(k56f,k34f))/(zaP34b(k34f,k34f))
     &    /(zaP34b(k34f,k34f))/(zaP34b(k56f,k34f))*za(k6,k34f)*zb(k2,k4
     &    )*zb(k3,k56f)*zb(k4,k34f)*zb(k5,k34f)*zaP34b(k1,k34f)*s34 -
     &    1/(zb(k2,k3))/(zb(k2,k3))/(zb(k4,k56f))/(zb(k56f,k34f))/(
     &    zaP34b(k34f,k34f))/(zaP34b(k34f,k34f))/(zaP34b(k56f,k34f))*
     &    zb(k2,k4)*zb(k3,k56f)*zb(k5,k34f)*zaP34b(k1,k34f)*zaP34b(k6,
     &    k34f)*zaP34b(k34f,k4) + 1/(zb(k2,k3))/(zb(k2,k3))/(zb(k4,k56f
     &    ))/(zb(k56f,k34f))/(zaP34b(k34f,k34f))/(zaP34b(k34f,k56f))/(
     &    zaP34b(k56f,k56f))*za(k6,k34f)*zb(k2,k4)*zb(k3,k56f)*zb(k4,
     &    k34f)*zb(k5,k56f)*zaP34b(k1,k56f)*s34 + 1/(zb(k2,k3))/(zb(k2,
     &    k3))/(zb(k4,k56f))/(zb(k56f,k34f))/(zaP34b(k34f,k56f))/(
     &    zaP34b(k56f,k56f))/(zaP34b(k56f,k56f))*zb(k2,k4)*zb(k3,k56f)*
     &    zb(k5,k56f)*zaP34b(k1,k56f)*zaP34b(k6,k56f)*zaP34b(k56f,k4) )
      coeff(2,b34) = coeff(2,b34) + mb*bp**(-1)*s1234**(-1) * (  - 1/(
     &    zb(k2,k3))/(zb(k2,k3))/(zb(k4,k56f))/(zaP34b(k4,k4))/(zaP34b(
     &    k34f,k4))/(zaP34b(k34f,k34f))/(zaP34b(k56f,k4))*za(k6,k34f)*
     &    zb(k2,k4)*zb(k3,k4)*zb(k4,k5)*zaP34b(k1,k4)*s34**2 - 1/(zb(k2
     &    ,k3))/(zb(k2,k3))/(zb(k4,k56f))/(zaP34b(k4,k34f))/(zaP34b(
     &    k34f,k34f))/(zaP34b(k34f,k34f))/(zaP34b(k56f,k34f))*za(k6,
     &    k34f)*zb(k2,k34f)*zb(k3,k4)*zb(k5,k34f)*zaP34b(k1,k34f)*
     &    s34**2 + 1/(zb(k2,k3))/(zb(k2,k3))/(zb(k4,k56f))/(zaP34b(k34f
     &    ,k4))/(zaP34b(k34f,k34f))/(zaP34b(k56f,k4))*za(k6,k34f)*zb(k2
     &    ,k4)*zb(k3,k4)*zb(k4,k5)*zaP34b(k1,k4)*s34 + 1/(zb(k2,k3))/(
     &    zb(k2,k3))/(zb(k4,k56f))/(zaP34b(k34f,k34f))/(zaP34b(k34f,
     &    k34f))/(zaP34b(k56f,k34f))*za(k6,k34f)*zb(k2,k4)*zb(k3,k4)*
     &    zb(k5,k34f)*zaP34b(k1,k34f)*s34 )


c--------------------------- TADPOLE ----------------------------------

c--- definition of massive tadpole (simply related to tree amplitude)
      coeff(1,a0m)=amplo/2d0/msq

c--- determine missing bubble (massive self energy) from pole structure
      coeff(2,b2x1m)=8d0/3d0*ampLO-msq*coeff(1,a0m)
     & -coeff(2,b123)-coeff(2,b234)-coeff(2,b23)
     & -coeff(2,b1234)-coeff(2,b12)-coeff(2,b34)

c---------------------------- RATIONAL TERMS --------------------------

      coeff(0,irat)= + mb*s1234**(-1) * (  - 1/(za(k2,k3))/(zb(k2,k3))
     &    /(zb(k2,k3))/(zaP23b(k1,k1))*za(k1,k2)*za(k1,k6)*zb(k1,k2)*
     &    zb(k4,k5) + 1/(za(k2,k3))/(zb(k2,k3))/(zb(k2,k3))/(zaP23b(k4,
     &    k4))*za(k1,k6)*za(k2,k4)*zb(k2,k4)*zb(k4,k5) - 1.D0/2.D0/(za(
     &    k2,k3))/(zb(k2,k3))/(zb(k2,k3))/(zaP123b(k4,k4))*za(k1,k2)*
     &    za(k4,k6)*zb(k2,k4)*zb(k4,k5) + 1.D0/2.D0/(za(k2,k3))/(zb(k2,
     &    k3))/(zb(k2,k3))/(zaP123b(k4,k4))*za(k1,k3)*za(k4,k6)*zb(k3,
     &    k4)*zb(k4,k5) + 1.D0/2.D0/(za(k2,k3))/(zb(k2,k3))/(zb(k2,k3))
     &    /(zaP234b(k1,k1))*za(k1,k2)*za(k1,k6)*zb(k1,k5)*zb(k2,k4) - 1.
     &    D0/2.D0/(za(k2,k3))/(zb(k2,k3))/(zb(k2,k3))/(zaP234b(k1,k1))*
     &    za(k1,k3)*za(k1,k6)*zb(k1,k5)*zb(k3,k4) + 1/(zb(k2,k3))/(
     &    zaP23b(k1,k1))/(zaP23b(k4,k1))*za(k1,k2)*za(k1,k6)*zb(k1,k2)*
     &    zb(k1,k5) + 1.D0/2.D0/(zb(k2,k3))/(zaP23b(k4,k1))*za(k1,k6)*
     &    zb(k1,k5) - 1.D0/2.D0/(zb(k2,k3))/(zaP23b(k4,k1))*za(k4,k6)*
     &    zb(k4,k5) - 1/(zb(k2,k3))/(zaP23b(k4,k1))/(zaP23b(k4,k4))*za(
     &    k2,k4)*za(k4,k6)*zb(k2,k4)*zb(k4,k5) )
      coeff(0,irat) = coeff(0,irat) + mb*s123*s1234**(-1) * (  - 1.D0/2.
     &    D0/(za(k2,k3))/(zb(k2,k3))/(zb(k2,k3))/(zaP23b(k4,k1))/(
     &    zaP123b(k4,k4))*za(k2,k4)*za(k4,k6)*zb(k2,k4)*zb(k4,k5) + 1.D0
     &    /2.D0/(za(k2,k3))/(zb(k2,k3))/(zb(k2,k3))/(zaP23b(k4,k1))/(
     &    zaP123b(k4,k4))*za(k3,k4)*za(k4,k6)*zb(k3,k4)*zb(k4,k5) )
      coeff(0,irat) = coeff(0,irat) + mb*s234*s1234**(-1) * ( 1.D0/2.D0
     &    /(za(k2,k3))/(zb(k2,k3))/(zb(k2,k3))/(zaP234b(k1,k1))/(
     &    zaP23b(k4,k1))*za(k1,k2)*za(k1,k6)*zb(k1,k2)*zb(k1,k5) - 1.D0/
     &    2.D0/(za(k2,k3))/(zb(k2,k3))/(zb(k2,k3))/(zaP234b(k1,k1))/(
     &    zaP23b(k4,k1))*za(k1,k3)*za(k1,k6)*zb(k1,k3)*zb(k1,k5) )
      coeff(0,irat) = coeff(0,irat) - 2.D0/9.D0*amplo



c-- ADDITIONAL CONVERSION FOR BOXES AND TRIANGLES: 6-D TO 4-D BASIS ---
      coeff(4,d2x3x4)=coeff(4,d2x3x4)*za(k2,k3)*zb(k3,k2)*zab(k4,p3,k4)

      coeff(4,d1x2x3)=coeff(4,d1x2x3)*za(k2,k3)*zb(k3,k2)*zab(k1,p2,k1)

      coeff(4,d1x23x4)=coeff(4,d1x23x4)*zab(k4,p23,k1)*zab(k1,p23,k4)

      coeff(4,d1x2x34)=coeff(4,d1x2x34)*s234*zab(k1,p2,k1)
      coeff(4,d12x3x4)=coeff(4,d12x3x4)*s123*zab(k4,p3,k4)

      coeff(3,c23x4)=coeff(3,c23x4)*(-zab(k4,p23,k4))
      coeff(3,c1x23)=coeff(3,c1x23)*(-zab(k1,p23,k1))
      coeff(3,c3x4)=coeff(3,c3x4)*(zab(k4,p3,k4))
      coeff(3,c1x2)=coeff(3,c1x2)*(zab(k1,p2,k1))
      coeff(3,c1x234)=coeff(3,c1x234)*(-zab(k1,p234,k1))
      coeff(3,c123x4)=coeff(3,c123x4)*(-zab(k4,p123,k4))

      return
      end

